import axios from "axios"
import { GET_ERRORS} from "./types";

export const getBookings = bookingData => dispatch => {
    axios
      .post("http://localhost:5000/api/expert/bookings", bookingData)
      .then(res => {
          let data = res.data;
       return data.bookings;
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };
